# l1 : normales, l2 : adversaires
def separation(V, A1, A2, A3):
    p1, p2, p3 = 0, 0, 0
    while np.percentile(V, p1) < np.percentile(A1, 100-p1):
        p1 += 1
    while np.percentile(V, p2) < np.percentile(A2, 100-p2):
        p2 += 1
    while np.percentile(V, p3) < np.percentile(A1, 100-p3):
        p3 += 1
    # p = max(p1, p2, p3)
    p = 4
    return (p, np.percentile(V, p),
            np.percentile(A1, 100-p),
            np.percentile(A2, 100-p),
            np.percentile(A3, 100-p))
